  input: '"TEXT","F3A","","With regard to your letter dated September 9, 2004, the
    Committee is very aware of the 48-hour reporting periods and during those time
    periods all persons involved in the campaign are reminded (several times) of the
    requirements and procedures so that any checks that are received are properly
    and timely noticed.  With regard to the check from the AGA PAC, the report reflects
    the deposit date and not the receipt date as was required, which is how it got
    missed in the 48-hour report.  The fundraiser actually received that check on
    May 12, 2004, which was outside the 48-hour reporting period, but it was deposited
    on May 25, 2004, which was inside the 48-hour reporting period.  Had the receipt
    date been entered it would not have been required to have been reported.  With
    regard to the check from the American Forest and Paper Assn. PAC, it somehow did
    not get reported even though a 48-hour report was filed that day.  As a result,
    we have again reviewed our 48-hour procedures and made some adjustments in preparation
    for the general election."'
